  $strings['Use this page to set up the connection details for your LDAP or Active Directory server. It is highly recommended that you read the online help before use, as misconfiguration may prevent you from accessing configuration pages to rectify issues.'] = '使用此页设置您的LDAP或Active Directory服务器的连接详细信息。我们强烈建议您在使用前阅读在线帮助，从而避免出现错误的配置。';
