  $strings['Important information'] = '重要信息';
  $strings['When you enable LDAP as your authentication backend in Authentication configuration, you will lose access to all accounts which do not also exist in the LDAP database. This may mean you lose administrative access.'] = '当您启用LDAP作为您的身份认证后端配置时，所有LDAP数据库不存在的用户将无法访问系统。这可能意味着您失去了管理员访问权限。';
  $strings['To resolve this issue, either import all users using the tool on this page and make one an administrator using Users configuration, or create a user with the same username as one in LDAP and make that one an administrator.'] = '为了解决这个问题，在导入所有用户后，使用用户管理将其中一名用户设置为管理员或在LDAP创建一个管理员用户';
  $strings['Connection details'] = '连接详情';
  $strings['Hostname'] = '主机名';
  $strings['Use URL syntax (ldap://hostname:port). If your server requires SSL, use ldaps://hostname/ in this field.'] = 'URL语法 (ldap://hostname:port). 如果您的服务器要求使用SSL, 请使用 ldaps://hostname/ .';
  $strings['Base DN'] = 'Base DN';
