  $strings['Group members attribute'] = '组成员属性';
  $strings['This field should contain the name of the attribute where the list of members of a group is stored, such as uniqueMember.'] = '组中存储成员的属性名, 例如 uniqueMember.';
  $strings['Allowed groups'] = '允许的用户组';
