  $strings['Control username'] = '用户名';
  $strings['Control user password'] = '密码';
  $strings['Please insert the authentication details for a user who can access all LDAP records. Only read only access is necessary, and for an anonyous bind leave this blank.'] = '请填上谁可以访问所有的LDAP用户的身份验证详细信息，只读访问是必要的。如果匿名访问则无需填写';
  $strings['Click "%save%" to save the settings'] = '点击 "%save%" 保存所有设置';
  $strings['Save'] = '保存';
  $strings['Test connection'] = '连接测试';
  $strings['After configuring and saving your connection settings, you should test your connection to the LDAP server. This test does not check whether the DN and attributes can allow The Bug Genie to correctly find users, but it will give an indication if The Bug Genie can talk to your LDAP server, and if any groups you specify exist.'] = '配置并保存连接设置之后，应该测试到LDAP服务器的连接是否可用。这个测试并不是检查 DN 以及其它属性是否允许BugGenie正确的找到用户，而是为了标识BugGenie能否和你的LDAP服务器通信，以及检查你指定的分组是否存在。';
  $strings['Import all users'] = '导入所有用户';
  $strings['You can import all users who can log in from LDAP into The Bug Genie with this tool. This will not let them log in without switching to LDAP Authentication. We recomemnd you do this before switching over, and make at least one of the new users an administrator. Already existing users with the same username will be updated.'] = '您可以通过该工具从LDAP导入登录用户，但是为了让这些用户正常登录，您必须将认证方式更改为LDAP认证。我们强烈推荐你在切换登陆方式之前指定至少一名LDAP登录用户为管理员。所有存在相同用户名的用户将会被更新。';
  $strings['Import users'] = '导入用户';
  $strings['Prune users'] = '删除用户';
  $strings['To remove the data from The Bug Genie of users who can no longer log in via LDAP, run this tool. These users would not be able to log in anyway, but it will keep your user list clean. The guest user is not affected, but it may affect your current user - if this is deleted you will be logged out.'] = '运行此工具以删除不能通过LDAP访问系统的用户，使得不能登陆的用户从您的用户列表中清理干净。 来宾用户不会受到影响，但它可能会影响当前登陆用户 - 如果当前用户被删除，则将被注销。';

